sys_variable_value.value:
(function execute(inputs, outputs) {

  var sdtvalue = inputs.sdtime;
  var sdt = new GlideDateTime(sdtvalue);
  var sgd = sdt.getLocalDate();
  var sgt = sdt.getLocalTime();
  var formatteddatesdt = sgd.getByFormat('yyyy-MM-dd') +'T'+ sgt.getByFormat('HH:mm:ss')+'Z';
  outputs.longsdt= formatteddatesdt;
  // ... code ...
})(inputs, outputs);

